export default function Dashboard(){
    return(
        <div >

            <div className='text-white bg-[#e7c158] py-3 px-7 rounded-2xl font-mont font-neon'>
                <Clock format={'HH:mm:ss'} ticking={true} timezone={'VN'} date={''} />
                <div></div>
                <Clock format={'ddd, MMM D YYYY'} ticking={true} timezone={'VN'} date={''} />
            </div>
       
        </div>
    )
}
